<?phpnamespace Nemundo\Roundshot\Install;use Nemundo\App\Application\Type\Install\AbstractUninstall;use Nemundo\App\Scheduler\Setup\SchedulerSetup;use Nemundo\Content\Setup\ContentTypeSetup;use Nemundo\Model\Setup\ModelCollectionSetup;use Nemundo\Roundshot\Application\RoundshotApplication;use Nemundo\Roundshot\Content\Roundshot\RoundshotWidgetContentType;use Nemundo\Roundshot\Content\RoundshotKml\RoundshotKmlContentType;use Nemundo\Roundshot\Content\Webcam\RoundshotWebcamContentType;use Nemundo\Roundshot\Data\RoundshotModelCollection;use Nemundo\Roundshot\Scheduler\RoundshotImportScheduler;class RoundshotUninstall extends AbstractUninstall{    public function uninstall()    {        (new ContentTypeSetup(new RoundshotApplication()))            ->removeContentType(new RoundshotWidgetContentType())            ->removeContentType(new RoundshotWebcamContentType())            ->removeContentType(new RoundshotKmlContentType());        (new ModelCollectionSetup())            ->removeCollection(new RoundshotModelCollection());        (new SchedulerSetup(new RoundshotApplication()))            ->removeScheduler(new RoundshotImportScheduler());    }}